INSERT INTO `carrera` VALUES (1,'contador pblico','{subtitle}Perfil profesional{br}\n El Contador Pblico esta capacitado para dar expresin numrica y conceptual a las distintas situaciones que conforman la actividad de una organizacin y que tienen algn tipo de repercusin econmica en ella. Le permitir reflejar a travs de balances u otros reportes contables, los resultados de la gestin, produciendo y proporcionando informacin y un asesoramiento til en cuestiones administrativo-contables.{br}\n {subtitle}Insercin laboral{br}\n - Administracin pblica.{br}\n - Empresas privadas.{br}\n - Entidades bancarias y financieras.{br}\n - Peritaje y sindicaturas concursales.{br}\n En los mbitos de actuacin mencionados (los cuales son enunciativos y no taxativos) podr ejercer su profesin con conducta tica y respeto al Bien Comn, lo que redundar en un permanente y positivo aporte a la comunidad.',4,1,1,'https://drive.google.com/uc?export=view&id=1sKMXZ3YOsoz7Dt0acQJvekzdSOk7cujd\n','https://drive.google.com/uc?export=view&id=12VFlduP5O10Bkhg8n1JXT1tquwz-AdAv\n'),(2,'licenciatura en administracin de empresas','{subtitle}Perfil profesional{br}\n El Licenciado en Administracin de Empresas UNSTA es un profesional capacitado para administrar recursos de manera eficiente dirigiendo organizaciones pblicas o privadas, grandes corporaciones o PYME\'s, con o sin fines de lucro adaptado siempre a las innovaciones tecnolgicas y avances de la informacin en ambientes complejos, o bien para emprender oportunidades de negocios propios frente a oportunidades detectadas.{br}\n {subtitle}Insercin laboral{br}\n - Anlisis, planeamiento, organizacin y control de empresas, en el marco de los valores ticos y sociales brindados durante su formacin.{br}\n - Su campo laboral abarca el mbito privado y el pblico, grandes medianas y pequeas empresas o propios emprendimientos, donde evaluar proyectos de inversin y situaciones econmicas financieras.{br}\n - Liderar equipos de trabajo y efectuar anlisis y diagnsticos del contexto internacional donde se inserta una organizacin.{br}\n - Sus competencias permiten tomar decisiones sobre el mejor uso de los recursos evaluando los riesgos producto de la incidencia de variables internas y externas a la organizacin.{br}',4,2,1,'https://drive.google.com/uc?export=view&id=1mSM2oDszv15A1xiqMqP4egmWO9NSJxTk\n','https://drive.google.com/uc?export=view&id=1fXXNzZUiYp_GyQFNZvDh1aeadReeAwiv\n'),(3,'abogaca','{subtitle}Perfil profesional{br}\n La carrera de Abogaca de la UNSTA espera que el graduado desarrolle competencias para defender y observar la C.N., sus declaraciones, derechos y garantas tanto del ciudadano como de la sociedad. Ejercer control de constitucionalidad tanto en el mbito pblico como privado, de mayora y minoras preservando un poder judicial independiente.{br}\n Reconocer las necesidades sociales en relacin con las transformaciones del Derecho en un contexto de Estado social, democrtico y de compromiso con la promocin de los Derechos Humanos y el cuidado del Medio Ambiente. Guardar independencia ante los poderes pblicos, magistrados y dems autoridades. Actuar con independencia de todo inters que no sea coincidente con el de la justicia y con el de la libre defensa de su cliente.{br}\n Defender las libertades civiles y polticas que aseguren el respeto de la dignidad humana y el bienestar general de una sociedad multicultural y globalizada. Analizar crticamente el sistema jurdico e incentivar el inters por la investigacin. Reconocer la apertura hacia otros campos del conocimiento.{br}\n Actuar con lealtad, probidad y buena fe en el desempeo profesional. Observar con fidelidad el secreto profesional, con las salvedades establecidas por la ley. Asistir en la solucin de conflictos en el mbito extrajudicial como judicial reconociendo los mtodos alternativos de resolucin de conflictos.{br}\n Reconocer las diferentes opciones que brinda un tribunal multipuertas y saber asesorar a su cliente sobre brindar una eficaz y oportuna solucin a su conflicto. Practicar el asesoramiento, defensa o patrocinio jurdico de personas carentes de recursos.{br}\n Garantizar la defensa en juicio. Desempearse como auxiliar de la justicia, prestando asistencia como colaborador del juez.',5,1,2,'https://drive.google.com/uc?export=view&id=18w6M-2RvTG_kSUaILIYnPviKNOhh34Je\n','https://drive.google.com/uc?export=view&id=1tNWFA4p2AzUTzo_3ZrHdj-fN-lwFK6A9\n'),(4,'licenciatura en ciencias polticas','{subtitle}Perfil profesional{br}\n El Licenciado en Ciencia Poltica  ser un profesional con una amplia formacin interdisciplinaria que lo capacita para analizar y diagnosticar la realidad poltica, el desarrollo de fenmenos sociopolticos y la opinin pblica. As mismo, llevar a cabo trabajos de investigacin social como tareas ligadas al desarrollo institucional, direccin en la gerencia y gestin pblica y privada, la formulacin, evaluacin y desarrollo de polticas pblicas; asesoramiento pblico y privado, armado ntegro de campaas electorales.{br}\n {subtitle}Conocimientos{br}\n - Adquirir conocimientos y formacin general - filosfica, jurdica, econmica y poltica-, relacionados con la problemtica poltica.{br}\n - Conocer la problemtica nacional e internacional, a travs de las ideas y movimientos ms significativos en la historia del pensamiento poltico y en la actualidad.{br}\n - Aprender nociones de participacin y representacin del poder en la actualidad del sistema argentino y las organizaciones participativas empresariales, sindicales y culturales.{br}\n - Adquirir una formacin interdisciplinar mediante el estudio de las diversas perspectivas histrico-doctrinales y las grandes lneas y escuelas econmicas.\n - Adquirir conocimientos humansticos a travs de una currcula especfica que brinda el Departamento Humanstico.{br}\n {subtitle}Habilidades{br}\n - Analizar y descubrir los supuestos ideolgicos de la poltica internacional y los factores de poder que la configuran.{br}\n - Identificar e interpretar los aspectos ms significativos de la realidad sociopoltica contempornea.{br}\n - Evaluar las implicancias doctrinales, histricas y jurdicas de las relaciones entre la religin y la poltica, de modo especial en occidente cristiano.{br}\n - Profundizar la problemtica del Estado en nuestro rgimen federativo y la personificacin de la Nacin en el plano interno y el internacional.{br}\n - Manejar las tcnicas de investigacin y los mtodos propios de la Ciencia Poltica con el objeto de criticar e interpretar los orgenes, evolucin y realidad actual de las distintas corrientes polticas vigentes en nuestro pas y en las corrientes polticas internacionales.{br}\n - Potenciar la capacidad de mando, ejecucin y administracin de la cosa pblica.{br}\n - Analizar la relacin de la poltica con la economa, la comunicacin y el derecho, junto con los temas contemporneos de la poltica argentina y latinoamericana.{br}\n \n {subtitle}Actitudes{br}\n - Valorar las riquezas de la Ciencia Poltica.{br}\n - Cultivar un pensamiento crtico de la realidad.{br}\n - Desempear su rol con un claro compromiso tico.{br}\n \n {subtitle}Alcances del ttulo{br}\n A dos reas: a) investigacin, difusin y promocin del conocimiento poltico como la aplicacin de ese conocimiento al anlisis de la vida poltica e institucional del pas; y b) la gestin, el planeamiento y la toma de decisiones en el sector pblico o privado en el rea pertinente a la disciplina de la Ciencia Poltica.{br}\n \n En tal sentido, el ttulo lo habilita para desempearse en las siguientes actividades profesionales:{br}\n - Ejercer la actividad poltica propiamente dicha.{br}\n - Desarrollar tareas de investigacin y estudio en equipos interdisciplinarios de temticas referentes a las relaciones de poder y autoridad entre individuos, grupos y organizaciones que integran el campo poltico y social;{br}\n - Describir y predecir fenmenos polticos; y abordar analticamente procesos de toma de decisin y funcionamiento de estructuras y sistemas polticos.{br}\n - Actuar como analistas de opinin pblica en medios de comunicacin y colaborar en la elaboracin y estudio de campaas electorales, anlisis del discurso, asesoramiento y consultora en general, elaboracin de aplicacin de tecnologas de la informacin y la comunicacin en el rea de la Ciencia Poltica.{br}\n - Participar en la planificacin, elaboracin, ejecucin, diagnstico y control de polticas pblicas, en distintas esferas del Estado.{br}\n - Colaborar, junto a otros profesionales, en organismos y mbitos relacionados con diplomacia internacional, comercio exterior, ayudas humanitarias y desarrollo de estudios referentes al anlisis de fenmenos de la poltica internacional.{br}\n - Trabajar en reas y espacios institucionales de organizaciones del tercer sector y la sociedad civil que interacten con el Estado y que sus tareas estn vinculadas a la gestin y el control de las actividades polticas, formulando proyectos colaborativos con gobiernos provinciales, nacionales y/o organismos internacionales;{br}\n - Coordinar equipos de trabajo en lo ateniente al rea de la Ciencia Poltica.{br}\n \n {subtitle}PPS y Pasantas{br}\n A partir del 2do semestre del 1er ao de inscripcin, los alumnos pueden acceder a PPS (field projects) gracias a convenios que la UNSTA mantiene con instituciones pblicas y privadas, para favorecer el ejercicio prctico y permanente de los alumnos, fortalecer su trayecto acadmico y facilitar su futura insercin laboral.{br}\n \n Algunas de las instituciones tucumanas son: Secretara de Estado de Gobierno y Justicia; Escuela de Gobierno de la Provincia; Honorable Legislatura de Tucumn; Direccin de Asuntos Comunitarios y Sociales del Ministerio del Interior; Secretara de Estado de Gestin Pblica y Planeamiento; Subsecretara de Tecnologas de la Informacin; Direccin de Estadstica; Instituto Provincial de la Administracin Pblica (IPAP).',4,2,2,'https://drive.google.com/uc?export=view&id=1Neg5fr9ghZ0414opCxWIfc8tBagf-7cw\n','https://drive.google.com/uc?export=view&id=1PB4t5zAGq4qysuOoyHL0YclDnTd7r8Z3\n'),(5,'medicina','{subtitle}Perfil profesional{br}\n Se busca que el perfil del egresado sea un mdico general con orientacin familiar y comunitaria, comprometido con la realidad socio sanitaria de la regin y del pas; con principios humansticos slidos capaz de brindar atencin medica de alta calidad cientfica y tcnica.{br}\n \n {subtitle}Diseo Curricular{br}\n El diseo curricular de la carrera de medicina de la UNSTA es una currcula integrada, orientada a la comunidad, basado en el desarrollo de competencias y con estrategias de aprendizaje colaborativo. Se propone el anlisis de la realidad y de diferentes situaciones de salud a partir de 5 reas transversales en los 6 aos de la carrera: Biolgica, Ciencias del comportamiento, Humanstica, Social y Prctica profesional.{br}\n \n {subtitle}Debo rendir examen de ingreso?{br}\n Se inicia con un Ciclo de Nivelacin Acadmica (CNA) y al finalizar, se rinde un examen de ingreso. CUPOS LIMITADOS.{br}\n \n {subtitle}El CNA tiene costo?{br}\n Es sin costo para quienes abonen el derecho de examen de ingreso. El monto abonado se descontar de la matricula inicial a los alumnos ingresantes a medicina u otra carrera UNSTA.{br}\n \n {subtitle}Puedo inscribirme ahora?{br}\n Pods preinscribirte ahora en el Ciclo de Nivelacin Acadmica (CNA), abonando slo el derecho de examen. Pods acercarte a nuestras sedes Central o Yerba Buena, o preinscribirte online durante las 24 hs.',6,1,3,'https://drive.google.com/uc?export=view&id=1tCugZHVO7sWJ-lTT-B4HdTtFntOR0ysM\n','https://drive.google.com/uc?export=view&id=1NhwhpQPcRxVe6hkhshcJet3LqkttWRtN\n'),(6,'licenciatura en nutricin','{subtitle}Perfil profesional{br}\n El Licenciado en Nutricin es un profesional preparado para desempearse con competencia e idoneidad en las reas clnicas, comunitaria, educativa y de gestin .Es un profesional que cuenta con las herramientas necesarias para desempearse de manera individual, as como tambin participar de los equipos sanitarios, programar, administrar racionalmente los alimentos y evaluar acciones relacionadas con la alimentacin humana. Para ellos debe considerar aspectos fisiolgicos, psicolgicos, patolgicos, econmicos, sociales y culturales de la poblacin donde se encuentra inserto.{br}\n {subtitle}Insercin Laboral{br}\n - Est capacitado para el ejercicio libre de la profesin en consultora.{br}\n - Instituciones pblicas y privadas que prestan servicios de salud y educacin.{br}\n - Disear y planificar servicios de alimentacin para diversas instituciones (comedores institucionales, clnicas, hospitales, escuelas, etc).{br}\n - Planificacin y ejecucin de programas asistenciales que promueven la salud.{br}\n - Trabajos de investigacin en el rea salud.{br}\n - Asesora industrial y comercial en temas referidos a la produccin, conservacin y comercializacin de alimentos.',4,3,3,'https://drive.google.com/uc?export=view&id=1bbAnerRRhoUsw4UVsFacWZU11agUhhNr\n','https://drive.google.com/uc?export=view&id=10r0uGvEEBSh0aSq6JHUzDdDy4izu7xKS\n'),(7,'ingeniera en informtica','{subtitle}Perfil profesional{br}\n El Ingeniero en Informtica de UNSTA es un profesional que cuenta con slidos conocimientos para la conduccin de proyectos y el desarrollo de aplicaciones de software y software-hardware, bajo estructuras convencionales o modelos de Inteligencia Artificial, pudiendo adaptarse a nuevos desafos tecnolgicos.{br}\n \n {subtitle}Diseo curricular{br}\n Los estudiantes adquieren las habilidades metodologas y tcnicas para el anlisis, diseo, desarrollo y gestin de tecnologas, empleando estndares internacionales. La formacin se complementa con el entrenamiento en modernos laboratorios de ciencias bsicas, aplicadas como robtica, entre otras, y de desarrollo de proyectos de software de envergadura profesional, manteniendo contacto con clientes reales, que brindan al egresado la competencia adecuada para insertarse rpidamente en el mercado laboral.{br}\n \n{subtitle}Insercin Laboral{br}\n - Anlisis y Diseo de Sistemas de Informacin.{br}\n - Desarrollos de aplicaciones web y bajo redes de cualquier tipo.{br}\n - Diseo y construccin de sistemas empleando tcnicas y modelos de IA.{br}\n - Ejecucin y conduccin de proyectos de software.{br}\n - Coordinar el rea de sistemas de empresas y organizaciones.{br}\n - Trabajo interdisciplinario.{br}\n - Manejo de Idiomas.',5,1,4,'https://drive.google.com/uc?export=view&id=1k-zNgeEqbh5d5fB1ykV0cuLib3KXi6LP\n','https://drive.google.com/uc?export=view&id=1cVDvB0-TSyZmKhTK-bPg_HhGQXMsAxsA\n'),(8,'tecnicatura en desarrollo de software','{subtitle}Perfil profesional{br}\n El tcnico en desarrollo y calidad de software de la UNSTA ser capaz de:{br}\n - Participar eficientemente en proyectos de software, contando con conocimientos slidos para el desempeo de puestos especficos dentro del mismo.{br}\n - Colaborar con el desarrollo, implementacin y mantenimiento productos de software.{br}\n - Colaborar en la evaluacin y seleccin del software basados en los requerimientos del negocio.{br}\n - Comprender los fundamentos de la administracin de un proyecto de software.{br}\n - Responder a los cambios de contexto con un conocimiento adecuado sobre la naturaleza del hombre como persona, trabajando en equipo interdisciplinarios.{br}\n - Abordar las nuevas tecnologas con responsabilidad tico social.{br}\n \n {subtitle}Insercin laboral{br}\n - Colaborar en el Anlisis, Diseo, Desarrollo e implementacin de aplicaciones de software.{br}\n - Utilizar metodologas de desarrollo de software e interactuar con clientes en sesiones de captacin de necesidades.{br}\n - Mantener aplicaciones de software.{br}\n - Diseo y ejecucin de pruebas de software.{br}\n - Planteamiento de estrategias de control de la calidad y testing del software, para reducir los riesgos de un proyecto de software.{br}\n \n {subtitle}Requisitos{br}\n - Estudios secundarios completos y excepcionalmente los mayores de 25 aos que no renan esta condicin podrn ingresar siempre que demuestren, que tienen preparacin o experiencia laboral acorde a la carrera (Art N 7 Ley de Educacin Superior).{br}\n - La carrera podr admitir alumnos extranjeros, El Comit acadmico, en cada caso analizar los ttulos, los convenios existentes entre los distintos organismos de los pases, los planes de estudio y la duracin total, pudindose requerir adems una entrevista personal a los fines de asesorar sobre la incorporacin de los alumnos. Tambin sugerir los cursos de nivelacin necesarios.',3,2,4,'https://drive.google.com/uc?export=view&id=1Ft2xjgHf6hM9Gj5BEHD4gg0Ss0l5Ii3U\n','https://drive.google.com/uc?export=view&id=1eGarZJMOVBkiidU1xcpkO059CNbwLye4\n'),(9,'licenciatura en historia','{subtitle}La Carrera{br}\nLa carrera de Licenciatura en Historia (Ciclo de Complementacin Curricular) apunta a la formacin de investigadores y profesionales universitarios idneos en el anlisis y la produccin de conocimiento, privilegiando el abordaje metodolgico de enfoques, tcnicas y prcticas propias del oficio.{br}\n \n Adems, al finalizar su carrera, nuestros egresados estarn preparados para desempearse en mltiples campos vinculados al conocimiento histrico, integrando equipos interdisciplinarios en las reas del turismo, de la gestin de fuentes documentales, de la valorizacin del patrimonio cultural y en empresas editoriales, entre otras.{br}\n \n Las opciones de soporte educativo online y de la modalidad a distancia posibilitan un cursado gil, poniendo a disposicin de nuestros estudiantes las herramientas tecnolgicas necesarias para la adquisicin de contenidos de calidad y el intercambio permanente con sus docentes.{br}\n \n Esta propuesta garantiza el acompaamiento continuo y personalizado del proyecto de investigacin del estudiante, desde el inicio de cursado hasta la defensa de la tesina de licenciatura.{br}\n \n {subtitle}Caractersticas{br}\n La Licenciatura en Historia tiene una duracin de cinco (5) semestres:{br}\n - En los primeros cuatro semestres se cursarn distintas materias, anuales o cuatrimestrales, seminarios optativos y un espacio humanstico.{br}\n - Durante los dos aos se dictar metodologa de la investigacin, que incluye la elaboracin del proyecto de tesina en primer ao y el taller de redaccin en el segundo.{br}\n - En el ltimo semestre est prevista la elaboracin de la versin final de la tesina.{br}\n \n {subtitle}Admisin{br}\n Para poder cursar la carrera es necesario haber obtenido el ttulo de Profesor de Historia con cuatro (4) aos de duracin, con una carga horaria mayor a 2800 horas reloj.{br}\n \n {subtitle}Objetivos{br}\n - Articular los trayectos educativos de institutos de formacin docente con la carrera universitaria.{br}\n - Ofrecer la posibilidad de explorar nuevos campos de desempeo profesional vinculados con los avances de la disciplina histrica.{br}\n - Ampliar el campo de accin del docente brindando a los futuros licenciados herramientas para la investigacin y el anlisis de la produccin del conocimiento.',2,2,5,'https://drive.google.com/uc?export=view&id=1UQxmYMA35eJ7-dQFdcIN0OZQtJ_6N0Ac\n','https://drive.google.com/uc?export=view&id=1QW5-JQut9KmbQz62XNU_LfbxbTXVGMqW\n'),(10,'profesorado en ciencias econmicas','{subtitle}Perfil profesional{br}\n El profesorado en Ciencias Econmicas es una carrera diseada especficamente para potenciar las competencias pedaggicas de los profesionales que se desempean en el mbito de la Economa y Administracin. Tiene duracin de 2 aos y se dicta integrando actividades sincrnicas y asincrnicas.{br}\n Se trata de un itinerario educativo con validez nacional (al cual se puede acceder nicamente con ttulo de grado) y una modalidad de aprendizaje basada principalmente en formas de investigacin guiada y puesta en comn de los saberes. Los procesos de evaluacin realizados por medio de trabajos de investigacin (en lugar de exmenes tradicionales) generan dinmicas innovadoras y creativas.{br}\n \n Desde el punto de vista prctico, los participantes reciben al inicio de cada cuatrimestre propuestas temticas que debern ser abordadas interdisciplinariamente, realizando por etapas sus propias investigaciones con el apoyo de un grupo de docentes. De esta manera el profesional/estudiante podr administrar sus tiempos y promover su formacin permanente, asimilando un nuevo modo de ensear y aprender.{br}\n \n {subtitle}Alcances del Ttulo{br}\n Nuestros egresados estarn capacitados para:{br}\n - Ejercer la docencia en los niveles de Educacin Secundaria y Superior del Sistema Educativo en el campo de la Economa y Administracin.{br}\n - Planificar, conducir y evaluar los procesos de enseanza y de aprendizaje en el Nivel Secundario y Superior en el campo de la Economa y de la Administracin.{br}\n - Participar activamente en equipos de trabajo para la planificacin y ejecucin de proyectos educativos institucionales de los Niveles de Educacin Secundaria y Superior.{br}\n - Colaborar con los equipos interdisciplinarios de las instituciones educativas en lo vinculante a la administracin y la economa institucional.',2,1,5,'https://drive.google.com/uc?export=view&id=1Ex119awNT4vPe-hdxLzsQt8KpftqSdfs\n','https://drive.google.com/uc?export=view&id=17OGXiKdjt0WG1XduZeAqwzvSeAP86RA9');
